import React from "react";

function App() {
  const src = "https://www.youtube.com/watch?v=6FEDrU85FLE";

  return (
    <iframe
      width="560"
      height="315"
      src={src}
      title="Youtube Player"
      frameborder="0"
      allowFullScreen
    />
  );
}

export default App;
